let flag = "";
const biome = new Map(),
  blocks = new Map();

function add(map, key, item, name) {
  if (!map.has(key)) map.set(key, new Map());
  map.get(key).set(item, name);
}

for (let line of log) {
  if (line == "Biomes:") {
    flag = "biome";
    continue;
  }
  if (line == "Blocks:") {
    flag = "block";
    continue;
  }
  if (line == "" && flag == "block") break;
  if (line == "") continue;

  if (flag == "biome") {
    const ans = line.substr(1).split("\t");
    const tag = ans[0].split(":");
    add(biome, tag[0], tag[1], ans[1]);
  }

  if (flag == "block") {
    const ans = line.split(", ");
    const tag = ans[0]
      .substr(1, ans[0].length - 2)
      .split(":")
      .slice(1);
    add(blocks, tag[0], tag[1], ans[1]);
  }
}

console.log(biome);
console.log(blocks);
